function fetchAuthCode () {
  fetch('/auth', {
    method: 'GET',
    headers: {
      'Content-Type': 'text/html'
    }
  })
    .then(res => res.text())
    .then(res => (window.location.href = res))
}



export default { fetchAuthCode }
